import React from "react";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";
import Calendar from "react-calendar";
import "react-calendar/dist/Calendar.css";

// Sample data
const entryData = [
  {
    time: "2025-02-01",
    mood: "high",
    sleepTime: 8,
    physicalHealth: "good",
  },
  {
    time: "2025-02-02",
    mood: "low",
    sleepTime: 6,
    physicalHealth: "bad",
  },
  {
    time: "2025-02-03",
    mood: "mid",
    sleepTime: 7,
    physicalHealth: "mid",
  },
  // Add more entries here
];

const Analytics = () => {
  // Process data for the charts
  const moodData = entryData.map((entry) => ({
    time: entry.time,
    mood: entry.mood === "high" ? 1 : entry.mood === "low" ? 0 : 0.5,
  }));

  const sleepData = entryData.map((entry) => ({
    time: entry.time,
    sleepTime: entry.sleepTime,
  }));

  const healthData = entryData.map((entry) => ({
    time: entry.time,
    health:
      entry.physicalHealth === "good"
        ? 1
        : entry.physicalHealth === "bad"
        ? 0
        : 0.5,
  }));

  const calendarData = entryData.map((entry) => ({
    date: new Date(entry.time),
    healthStatus: entry.physicalHealth,
  }));

  const renderHealthClass = (date) => {
    const entry = calendarData.find(
      (entry) => entry.date.toDateString() === date.toDateString()
    );
    if (entry) {
      if (entry.healthStatus === "good") return "green";
      if (entry.healthStatus === "bad") return "red";
      return "yellow";
    }
    return "gray";
  };

  return (
    <div>
      <h1>Analytics Page</h1>
      <p>View your app analytics here.</p>

      <div style={{ width: "100%", height: "300px" }}>
        <h2>Mood Over Time</h2>
        <ResponsiveContainer width="100%" height="100%">
          <LineChart data={moodData}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="time" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Line type="monotone" dataKey="mood" stroke="#8884d8" />
          </LineChart>
        </ResponsiveContainer>
      </div>

      <div style={{ width: "100%", height: "300px" }}>
        <h2>Sleep Time Over Time</h2>
        <ResponsiveContainer width="100%" height="100%">
          <LineChart data={sleepData}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="time" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Line type="monotone" dataKey="sleepTime" stroke="#82ca9d" />
          </LineChart>
        </ResponsiveContainer>
      </div>

      <div style={{ width: "100%", height: "300px" }}>
        <h2>Physical Health Over Time</h2>
        <ResponsiveContainer width="100%" height="100%">
          <LineChart data={healthData}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="time" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Line type="monotone" dataKey="health" stroke="#ff7300" />
          </LineChart>
        </ResponsiveContainer>
      </div>

      <div>
        <h2>Health Status Calendar</h2>
        <Calendar tileClassName={({ date }) => renderHealthClass(date)} />
      </div>
    </div>
  );
};

export default Analytics;
